rnd = new java.util.Random().nextGaussian()
while ({
   context.cb_bookingValue=(int)Math.round(rnd*30+80)
   context.cb_bookingCurrency="GBP";
   context.cb_numberOfSeats=(int)Math.round(rnd*0.5+2)
   context.cb_numberOfBags=(int)Math.round(rnd*0.5+1)
   context.cb_flowcontrol=rnd>=1?"true":"false"
   context.cb_percentusage=(Math.abs((int)Math.round(rnd*10+70)))
   context.cb_bookingValue<=1 || context.cb_numberOfSeats<0 ||context.cb_numberOfBags<0 
}()) continue

log.info(context.cb_percentusage+" "+context.cb_flowcontrol)
